    slide: {
        padding: 15,
        minHeight: 100,
        color: '#fff',
    },
    slide1: {
        background: '#FEA900',
    },
    slide2: {
        background: '#B3DC4A',
    },
    slide3: {
        background: '#6AC0FF',
    },
};

const Welcome = () => (
    <div class="swiper">
        <button>BRANDING/LOGO</button>
        <SwipeableViews enableMouseEvents>
            <div style={Object.assign({}, styles.slide, styles.slide1)}>
                slide n°1
            </div>
            <div style={Object.assign({}, styles.slide, styles.slide2)}>
                slide n°2
            </div>
            <div style={Object.assign({}, styles.slide, styles.slide3)}>
                slide n°3
            </div>
        </SwipeableViews>
        <style jsx>
            {`
                .swiper{
                    height: 100%;
                    width: 100vw;
                    min-height: 100vh;
                }
            `}
        </style>
        {/* <div>
